1 、 Los cupones de experiencia deben usarse dentro del tiempo válido; 
2 、 Los cupones de experiencia solo se pueden usar durante las transacciones de construcción de posición; 
3 、 Al usar cupones de experiencia para construir pedidos, no se requiere una tarifa de manejo; 
4 、 Al usar cupones de experiencia para crear pedidos, el número de pedidos debe ser el mismo que el número de cupones de experiencia; 
5 、 Al cerrar pedidos que han utilizado cupones de experiencia, la parte de ganancias va al usuario y la pérdida, el usuario no tiene ninguna pérdida
